const markdown = $json["truncated_markdown"] || "";

function extractTopGainers(markdown, topN = 5) {
  const blocks = markdown
    .split(/\n\[\]\(https:\/\/www\.webull\.com\/quote\/[^\)]+\)\n/)
    .slice(1);

  const gainers = blocks.map(block => {
    const lines = block.split('\n').map(l => l.trim()).filter(Boolean);
    const obj = {
      name: lines[0] || null,
      symbol: lines[1] || null,
      change_percent: lines.find(l => /^[\s]*[+\-]?\d+(\.\d+)?%$/.test(l.trim())) || null,
      last_price: lines[3] || null,
      high: lines[4] || null,
      low: lines[5] || null,
      volume: lines[6] || null,
      range_percent: lines[7] || null,
      pe_ratio: lines[8] || null,
      market_cap: lines[9] || null
    };
    return { json: obj };
  });
  return gainers.slice(0, topN);
}

return extractTopGainers($input.first().json.truncated_markdown, 5);

