// Get the latest gainer and latest loser from separate columns
const allRows = $input.all();

if (allRows.length === 0) {
  // No previous data exists
  return [{ json: { previous_gainer: '', previous_losers: '' } }];
}

// Find the latest non-empty gainer (search from bottom up)
let latestGainer = '';
for (let i = allRows.length - 1; i >= 0; i--) {
  if (allRows[i].json.previous_gainer) {
    latestGainer = allRows[i].json.previous_gainer;
    break;
  }
}

// Find the latest non-empty loser (search from bottom up)
let latestLoser = '';
for (let i = allRows.length - 1; i >= 0; i--) {
  if (allRows[i].json.previous_losers) {
    latestLoser = allRows[i].json.previous_losers;
    break;
  }
}

return [{ 
  json: { 
    previous_gainer: latestGainer, 
    previous_losers: latestLoser 
  } 
}];

